import React, {useState} from 'react';
import { Link, Navigate } from 'react-router-dom';

let Register = () => {
    let [actions, setActions] = useState([

        "Student",
        "Faculity",
        "Management",
        "Guide",
        "Other"
    ]);

    let [state, setState] = useState({
        user : {
            username: '',
            email: '',
            password: '',
            action:'',
            bio:'',
            terms: false

        }
    });

    let{user} = state;
    let updateInput = (e) =>{

        setState({
            ...state,
            user:{
                ...state.user,
                [e.target.name]: (e.target.name === "checkbox")? e.target.checked : e.target.value
            }
        }

        );

    };

    let Register = (e) => {
        e.preventDefault();  //stops / prevents the page refresh
        console.log(user);
    }

    // let Register = async (e) => {
    //     e.preventDefault();  //stops / prevents the page refresh
    //     Navigate("/viewstudents")
    // }

    return (
        <>
           <div className="landing">
               <div className="wrapper">
                   <div className="d-flex flex justify-content-left align-items-center h-100 text-center">
                       <h3 className='text-white'></h3>

                       <div className="grid m-5">

             <div className="container m-5">
                 <div className="row">
                     <div className="col-sm-10">

                         <div className="card shadow-lg">
                             <div className="card-header bg-success text-light">
                                 <p className='h4'>Register Here</p>
                             </div>
                             <div className='card-body bg-light'>
                                 <form onSubmit = {Register}> 
                                     <div className='mb-2'>

                                         <input 
                                        //  required={true}
                                         name ="username" 
                                         onChange={updateInput} 
                                         value = {user.username}
                                         type= "text" className='form-control' placeholder='Username' required/>
                                     </div>
                                     <div className='mb-2'>
                                         <input
                                         required={true}
                                          name ="password" 
                                          onChange={updateInput}
                                          value = {user.password}  
                                         type= "password" className='form-control' placeholder='Password'/>
                                     </div>
                                     <div className='mb-2'>
                                         <input 
                                        required={true}
                                           name ="email" 
                                          onChange={updateInput}
                                          value = {user.email} 
                                          type= "email" className='form-control' placeholder='Email'/>
                                     </div>

                                     <div className='mb-2'>
                                         <select 
                                         required={true}
                                         name ="action" 
                                         onChange={updateInput}
                                         value = {user.action}  
                                         className='form-control'>
                                             <option value="">Select Action</option>
                                             {
                                                 actions.map(action =>{
                                                     return(
                                                         <option 
                                                         key={action}
                                                         value = {action}>{action}</option>
                                                     )
                                                 })
                                             }
                                         </select>

                                     </div>
                                     <div className='mb-2'>
                                         <textarea 
                                         required={true}
                                          name ="bio" 
                                          onChange={updateInput}
                                          value = {user.bio} 
                                         rows={3} className = 'form-control' placeholder='bio'/>
                                     </div>

                                     <div className='mb-2'>
                                         <input
                                         required={true}
                                          name ="terms" 
                                          onChange={updateInput} 
                                          value = {user.terms}
                                         type= "checkbox" className='form-check-input'/>
                                         <span className='form-check-label'> Terms & Conditions</span>
                                     </div>

                                     {/* <p className="h3 text-success">
                             &nbsp; <Link to={'/students/add'} className="btn btn-success btn-sm"><i
                                 className="fa fa-plus-circle"/> New</Link>
                         </p> */}

                                     <div className='mb-2'>
                                         <Link to= {"/viewstudents"} input type="submit" className='btn btn-success' value="Submit">Register</Link>

                                     </div>


                                 </form>

                             </div>
                         </div>

                     </div>
                 </div>
             </div>
         </div>
                   </div>
               </div>
           </div>
        </>
    )
};
export default Register;
